import React, { Component } from 'react';

class FiftyFiftyRightList extends Component {
    state = {  }
    render() { 
        return ( 
            <div class="widget-f-flist">
                <div class="left-fifp">1</div>
                <div class="news_list">
                    <div>1</div>
                    <div>2</div>
                    <div>3</div>
                </div>
            </div>
         );
    }
}
 
export default FiftyFiftyRightList;
